contract Excercise {

struct CAR {
    string name;
    string model;
    uint year;
}

CAR car=CAR("Toyota", "Prado", 2000); 


function initCar1() public returns (CAR memory state, CAR  memory local) {
 CAR storage _car = car;
 _car.name="alto";
 _car.model="kia";
 _car.year=2012;

 return (car, _car) ;
}

function initCar2() public view returns (CAR memory state, CAR  memory local) {
 CAR memory _car = car;
 
}





